import React from "react";
import './index.css'
function Home(){

    return(
        <form className="cadastroBasico">
            <h1>Cadastro Basico</h1>
            <label>Nome:<input type="text"></input></label><br/>
            <label>Email:<input type="email"></input></label><br/>
            <div className="EC">
            <input type="submit" value="Enter"/>
            <input type="reset" name="c1" value="Cancelar"/>
            </div>
        </form>
    )
}

export default Home
